import React from 'react';
import { NavHashLink as Link } from 'react-router-hash-link';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'


const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Link smooth to="/home#about" activeStyle={{ color: "red" }}><NavigationButton>About</NavigationButton></Link>
                <Link smooth to="/home#experience"><NavigationButton>Experience</NavigationButton></Link>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
